import React, {Component} from 'react';
import Title from "../Title/Title";
import Motivation from "./Motivation";
import './Motivation.css'
import groupImage from '../../assets/group-consult-check1.jpg'
function MotivationSection(props) {
    const motivationLeftImageTitle = 'Для кого підійдуть групові заннятя?';
        return (
            <div className="motivation-section">
                <div className="container">
                    <Title text={motivationLeftImageTitle}/>
                    <div className="motivation__inner">
                        <Motivation text="Хто цікавиться психологією, психотерапією, особистісним розвитком.
Бажає покращити свої стосунки з партнером, батьками та з дітьми.
Прагне отримати базові знання з практичної психології.
Хто хоче зрозуміти краще себе та інших." title="Навчально-тренінгові групи" img={groupImage}/>
                    </div>
                </div>
            </div>
        );

}

export default MotivationSection;
